import { Routes, Route, Link } from 'react-router-dom';
import styled from 'styled-components';
import Home from './components/templates/home';
import Issue from './components/templates/issue';

const Header = styled.div`
  display: flex;
  padding: 16px;
  -webkit-box-pack: justify;
  justify-content: space-between;
  -webkit-box-align: center;
  align-items: center;
  width: 100%;
  background: rgb(51, 51, 51);
  color: white;
`;

const Gihtubviewer = styled.h1`
  white-space: nowrap;
  color: white;
`;

const Ulist = styled.ul`
  display: flex;
  width: 100%;
  padding: 0px 32px;

  li {
    margin-right: 16px;
    > a {
      color: white;
      font-size: 1.1rem;
    }
  }
`;

const List = styled.li``;

const Toggle = styled.div`
  padding: 8px;
  font-size: 1.2rem;
`;

const Icon = styled.i`
  cursor: pointer;
`;

const Main = styled.div`
  max-width: 896px;
  margin: 0px auto;
  padding: 32px 16px;
`;

function Pullrequest() {
  return <h2>Pull-request</h2>;
}

function App() {
  return (
    <div className="App">
      <Header>
        <Link to="/">
          <Gihtubviewer>Github Viewer</Gihtubviewer>
        </Link>
        <Ulist>
          <List>
            <Link to="/issue">Issue</Link>
          </List>
          <List>
            <Link to="/pull-request">Pull Request</Link>
          </List>
        </Ulist>
        <Toggle>
          <Icon className="fa fa-bars"></Icon>
        </Toggle>
      </Header>
      <Main>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="issue" element={<Issue />} />
          <Route path="pull-request" element={<Pullrequest />} />
        </Routes>
      </Main>
    </div>
  );
}

export default App;
